This is a bug fix for the aws-sdk type definition.

In the `putObject` method, `Metadata` is a map of strings, not an array as it's currently stated.

Citing [the docs](https://docs.aws.amazon.com/AWSJavaScriptSDK/latest/AWS/S3.html#putObject-property):

``` js
var params = {
  Bucket: 'STRING_VALUE', /* required */
  Key: 'STRING_VALUE', /* required */

  Metadata: {
    someKey: 'STRING_VALUE',
    /* anotherKey: ... */
  },
```

Exporting the Option interface allows `react-select` users to define types for methods that might take or return Options for the Select component.

For example,

``` js
import Select, { Option } from 'react-select';

// ...

<Select
    options={myOptions}
    name="myPicker"
    onChange={ (option) => { this.changeOption(dispatch, option as Option) } }
    placeholder="Show the data as"
    />

// ...

changeOption(dispatch: any, option: Option) {
    dispatch(myAction(option.value.toString()));
}

```
